import React from "react";
import { useSelector } from "react-redux";
function Profile() {
  const { user } = useSelector((state) => state.authReducer.user);
  return (
    <div>
      <h1>{user.username}</h1>
      <h3>{user.email}</h3>
    </div>
  );
}

export default Profile;
